const user1 = {
    name: 'Junior Prueba',
    username: 'chunior',
    country: 'Jamaica',
    social: {
        facebook: 'https://fb...',
        twitter: 'https://tw...'
    }
}

const saluda = (user) =>{
    const name = user.name;
    const country = user.country;
    console.log(
        `Hola soy ${name} y vivo en ${country}`
    );
    
}

saluda(user1);
